  CONSTRAINT `fk_Rating_History_Persons1` FOREIGN KEY (`Persons_id`) REFERENCES `persons` (`id`),
  CONSTRAINT `fk_rhdriver_id` FOREIGN KEY (`Drivers_id`) REFERENCES `drivers` (`driver_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8;
